//创建一个UUID 
import {createUUID} from '../encryption/index'
import servers from './Servers'
//获取公钥的函数 
export const getPublicKey = () =>{
  let UUID = {
    uuId:createUUID()
  }
  const url = '/users/public'
  return servers.post(url,UUID)  
}
